INSERT INTO SPR_PS
	VALUES ("030ecc1f-b03c-4e94-9fef-131634a0f85a",
	'ReadEmployeeList',
	'',
	'select many employeeSet from instances of Employee ; 
   
  LOG::LogInfo(message:"Sending employee set .." );	

  for each emp in employeeSet
	UI::SendEmployee( EmployeeID:emp.EmployeeID, NationalID:emp.NationalID, FirstName:emp.FirstName, MiddleName:emp.MiddleName, LastName:emp.LastName, Email:emp.Email,OfficePhone:emp.OfficePhone, DateOfBirth:emp.DateOfBirth, Degree:emp.Degree, Gender:emp.Gender, StartDate:emp.Start_Date, LeaveBalance:emp.LeaveBalance, SickLeaveBalance:emp.SickLeaveBalance, Salary:emp.getSalary());
	LOG::LogInfo(message:"Sent:"+ emp.FirstName+" "+emp.MiddleName+" "+emp.LastName);	
	LOG::LogReal( message:"Salary ", r:emp.getSalary() );


  end for;

  LOG::LogInfo(message:"Sending employee set is complete" );	
',
	1,
	0);
