INSERT INTO SPR_PS
	VALUES ("0a4e4392-ddd5-494c-a8bc-debd3db396ff",
	'AssignEmployeeBonus',
	'',
	'
//find an employee and assign the appropriate leave specifiction
select any employee from instances of Employee where selected.EmployeeID==param.EmployeeID;
select any bonusSpec from instances of BonusSpecification where selected.Name ==param.BonusName;

if ( not empty employee ) and ( not empty bonusSpec)
	create object instance empBonus of Bonus;
	
	relate empBonus to bonusSpec across R16.''is specified by'';
	relate employee to empBonus across R4.''gets a'';
	empBonus.Starting = param.Starting;
	empBonus.Ending = param.Ending;
	LOG::LogInfo(message:"Assign Employee Bonus: Assigning bonus to employee ");
	UI::Reply( msg:"Employee is assigned a bonus"+ bonusSpec.Name +" successfully ", state:True);
	

else
	LOG::LogInfo(message:"Assign Employee Bonus: Failed to find bonus or employee ");
	UI::Reply( msg:"Failed to find bonus or employee ", state:False);
	

end if;

',
	1,
	0);
