INSERT INTO SPR_PS
	VALUES ("8e083883-22a6-4d0a-949d-2682bc3fa100",
	'ReadEmployeeBonuses',
	'',
	'
select any employee from instances of Employee where selected.EmployeeID == param.EmployeeID;
select many bonuses related by employee->Bonus[R4.''gets a''] ; //where selected.Name==param.Name;

 
 if (not empty employee) and (not empty bonuses)
  UI::Reply( msg:"Sending bonus set .. ", state:True);

  for each bonus in bonuses
  	select one bonusSpec related by bonus->BonusSpecification[R16.''is specified by''];
	UI::SendEmployeeBonuses( BonusName:bonusSpec.Name, Starting:bonus.Starting, Ending:bonus.Ending, Percent:bonusSpec.Percent, Amount:bonus.Amount);
	
	UI::Reply( msg:"Sent: "+bonusSpec.Name, state:True);

  end for;
  
  	elif (empty bonuses)
  	  UI::Reply( msg:"Employee has no bonuses ", state:False);
  	
  	else
  	  	UI::Reply( msg:"Could not find Employee ", state:False);

  	end if;
',
	1,
	0);
