INSERT INTO SPR_PS
	VALUES ("a1171de9-3a45-4c21-a770-f3d1c3bf7d56",
	'ReadJobList',
	'Request for all registered jobs in the system',
	'select many jobs from instances of Job; 

if (not empty jobs) 
	LOG::LogInfo(message:"Sending jobs list .." );	
	
	for each job in jobs
		select one employee related by job->Employee[R6.''is assigned to''];
		if (not empty employee)
			UI::SendJobList( JobID:job.Job_ID, Title:job.Title, Salary:job.Salary, EmployeeName:employee.FirstName+" "+employee.LastName, EmployeeID:employee.EmployeeID);
			LOG::LogInfo(message:"Sent: Job "+ job.Title+", Assign to:  "+employee.FirstName+" "+employee.LastName);	
			LOG::LogReal( message:" Salary ", r:job.Salary );
		else
			UI::SendJobList( JobID:job.Job_ID, Title:job.Title, Salary:job.Salary, EmployeeName:"", EmployeeID:0);
			LOG::LogInfo(message:"Sent: Job "+ job.Title);
			LOG::LogReal( message:" Salary ", r:job.Salary ); 
		end if;
	end for;

  LOG::LogInfo(message:"Sending jobs list is complete" );	
  
  else 
  	LOG::LogInfo(message:"There are not jobs registered in the system" );	

  	UI::Reply( msg:"There are no jobs registered in the system", state:False );  
  end if; ',
	1,
	0);
