	VALUES ("8447949b-f51e-4647-acff-8e8c0a224436",
	'ReadBonusList',
	'',
	'select many bonuses from instances of BonusSpecification; 

if (not empty bonuses) 
	LOG::LogInfo(message:"Sending bonus list .." );	
	
	for each bonus in bonuses
			UI::SendBonusList( Name:bonus.Name, Percent:bonus.Percent );		
			LOG::LogReal(message:"Sent: Bonus "+ bonus.Name+", percent amount:", r:bonus.Percent);	
	end for;

  LOG::LogInfo(message:"Sending bonus list is complete" );	
  
  else 
  	LOG::LogInfo(message:"There are not bonuses registered in the system" );	

  	UI::Reply( msg:"There are no bonuses registered in the system", state:False );  
  end if; ',
	1,
	0);
