INSERT INTO SPR_PS
	VALUES ("c6dea0f8-5182-4a98-91bb-8ba8194dd5fc",
	'ReadDepartmentList',
	'',
	'select many departments from instances of Department; 

if (not empty departments) 
	LOG::LogInfo(message:"Sending department list .." );	
	
	for each department in departments
		select one mgrDep related by department->Department[R22.''is part of''];
		if (not empty mgrDep)
			managingDep = mgrDep.Name; 
			UI::SendDepartmentList( Name:department.Name, Mission:department.Mission, Description:department.Description, Manager:department.Manager, ManagingDepartment:managingDep)	;	
			LOG::LogInfo(message:"Sent: Department "+ department.Name+", managed by:"+department.Manager+" Managing Departmenet: "+ managingDep);
		else 
			UI::SendDepartmentList( Name:department.Name, Mission:department.Mission, Description:department.Description, Manager:department.Manager, ManagingDepartment:"");	
			LOG::LogInfo(message:"Sent: Department "+ department.Name+", managed by:"+department.Manager+" Managing Departmenet: "+ "");

		end if;			
	end for;

  LOG::LogInfo(message:"Sending department list is complete" );	
  
  else 
  	LOG::LogInfo(message:"There are no departments registered in the system" );	

  	UI::Reply( msg:"There are no departments registered in the system", state:False );  
  end if; ',
	1,
	0);
