INSERT INTO SPR_PS
	VALUES ("da858926-c602-4db1-b12b-b3dc33e3a552",
	'ReadGrades',
	'',
	'select any scale from instances of Scale where selected.Name==param.Name;

if (not empty scale)
	select many grades related by scale->Grade[R12.''is made of''];
	
if (not empty grades) 
	LOG::LogInfo(message:"Sending grade list .." );	

	for each grade in grades
		select one above related by grade->Grade[R14.''above'']; 
		select one bellow related by grade->Grade[R14.''bellow''];
		if (not empty above) and (not empty bellow)
			UI::SendGrades( Name:grade.Name, BaseSalary:grade.BaseSalary, Allowance:grade.Allowance, NumberOfSteps:grade.NumberOfSteps, Above:above.Name, Below:bellow.Name );	
			LOG::LogReal( message:"Sent: Grade: "+grade.Name+",", r:grade.BaseSalary);
			LOG::LogReal( message:", Allowance: ", r:grade.Allowance); 
			LOG::LogReal( message:", Base salary: ", r:grade.BaseSalary);
			LOG::LogInfo( message:", Grade above: "+above.Name );
			LOG::LogInfo( message:", Grade bellow: "+bellow.Name );
		elif ( empty above)
			UI::SendGrades( Name:grade.Name, BaseSalary:grade.BaseSalary, Allowance:grade.Allowance, NumberOfSteps:grade.NumberOfSteps, Above:"", Below:bellow.Name );	
			LOG::LogReal( message:"Sent: Grade: "+grade.Name+",", r:grade.BaseSalary);
			LOG::LogReal( message:", Allowance: ", r:grade.Allowance); 
			LOG::LogReal( message:", Base salary: ", r:grade.BaseSalary);
			LOG::LogInfo( message:", Grade above: none ");
			LOG::LogInfo( message:", Grade bellow: "+bellow.Name );
		elif ( empty bellow)
			UI::SendGrades( Name:grade.Name, BaseSalary:grade.BaseSalary, Allowance:grade.Allowance, NumberOfSteps:grade.NumberOfSteps, Above:"", Below:"" );	
			LOG::LogReal( message:"Sent: Grade: "+grade.Name+",", r:grade.BaseSalary);
			LOG::LogReal( message:", Allowance: ", r:grade.Allowance); 
			LOG::LogReal( message:", Base salary: ", r:grade.BaseSalary);
			LOG::LogInfo( message:", Grade above:  "+above.Name );
			LOG::LogInfo( message:", Grade bellow: none " );
		end if;			
	end for;

  LOG::LogInfo(message:"Sending grade list is complete" );	
  
  else 
  	LOG::LogInfo(message:"There are no grades registered in the system" );	

  	UI::Reply( msg:"There are no grades registered in the system", state:False );  
  end if; 
  
  else 
  	LOG::LogInfo(message:"There are no scales registered in the system" );	

  	UI::Reply( msg:"There are no scales registered in the system", state:False );  

  end if;
',
	1,
	0);
