INSERT INTO SPR_PS
	VALUES ("3bc42166-879d-4312-a1fe-76fe5029b705",
	'ReadEmployeePermissions',
	'It returns a group permission through sendEmployeePermissions',
	'select any account from instances of Account where selected.EmployeeID==param.EmployeeID ; 

select many groups related by account->Group[R1.''a member of''];


if (not empty account) and (not empty groups)
	LOG::LogInfo(message:"Sending employee account permissions .." );	
	
	for each group in groups
 		UI::SendEmployeePermissions( GroupName:group.Name, Description:group.Description );
		LOG::LogInfo(message:"Sent: Permission Groupd "+ group.Name+", Description:  "+group.Description);	
	end for;

  LOG::LogInfo(message:"Sending employee account permissions is complete" );	
  
  elif (empty account) or (empty groups)
  	LOG::LogInfo(message:"Employee either does not exist or has no account or has is not assigned a group" );	

  	UI::Reply( EmployeeID:0, Username:"", msg:"Employee either does not exist or has no account or has is not assigned a group", state:False );
  
  end if; ',
	1,
	0);
