INSERT INTO SM_ACT
	VALUES ("ac5e994e-9042-45f9-b776-37ddfc829d90",
	"55b03e70-b101-4405-b791-b5200cd0af6e",
	1,
	'//switch association from ceilling or requested  to funded representing an approved fund

select one chapterC related by self->Chapter[R116.''requested by ceilling''];

select one chapterR related by self->Chapter[R115.''requested by''];

select one oldSection related by self->Section[R105.''specified by''];
select one newSection related by self->Section[R106.''newly specified''];

if (not empty chapterC)
	relate self to chapterC across R111.''funded by'';
	
	if (not empty oldSection)
		LOG::LogInfo(message:"Existing section ceiling funding approved for "+oldSection.Name);
		UI::Reply( msg:"Existing section ceiling funding approved for "+oldSection.Name, state: true );
	elif (not empty newSection)
		LOG::LogInfo(message:"New ceiling funding approved for "+newSection.Name);
		UI::Reply( msg:"New ceiling funding approved for "+newSection.Name, state: true );
	else 
		LOG::LogInfo(message:"An error has occurred, ceiling funding has no section ");
		UI::Reply( msg:"An error has occurred, ceiling funding has no section ", state: false );

	end if;

elif (not empty chapterR)
	relate self to chapterR across R111.''funded by'';
	
	if (not empty oldSection)
		LOG::LogInfo(message:"Existing section requested funding approved for "+oldSection.Name);
		UI::Reply( msg:"Existing section requested funding approved for "+oldSection.Name, state: true );
	elif (not empty newSection)
		LOG::LogInfo(message:"New requested funding approved for "+newSection.Name);
		UI::Reply( msg:"New requested funding approved for "+newSection.Name, state: true );
	else 
		LOG::LogInfo(message:"An error has occurred, requested funding has no section ");
		UI::Reply( msg:"An error has occurred, requested funding has no section ", state: false );

	end if;

else
		LOG::LogInfo(message:"An error has occurred, requested funding has no chapter ");
		UI::Reply( msg:"An error has occurred, requested funding has no chapter ", state: false );

end if;


',
	'Assign a new association to accepted fund',
	0);
