INSERT INTO SPR_PS
	VALUES ("9f375415-1612-419e-abdb-470c8b9a8e59",
	'ReadStrategies',
	'',
	'select many strategies from instances of Strategy; 

if (not empty strategies)
	LOG::LogInfo(message:"Sending strategy set .. ");
	for each strategy in strategies
		UI::SendStrategies( Number:strategy.Number, Name:strategy.Name, Description:strategy.Description );
		LOG::LogInfo(message:"Strategy: Number "+strategy.Number+", Name:"+strategy.Name+", Description: "+strategy.Description);
	end for;
	LOG::LogInfo(message:"Sending strategy set is complete. ");

else
	LOG::LogInfo(message:"Strategy: No strategyies found in the system ");

end if;
',
	1,
	0);
